import React from "react";
import IInfos from "../../types";

export default function Lista({names}: {names: IInfos[]}){
    return(
        <div className="ListWrapper">
            <ul>
                {names.map((item: IInfos, index:any) => {
                <div>
                    <li key={index}>
                        {item.Model}</li>
                </div>
                     
                })}
            </ul>
        </div>

    )
}
